def gerade(x):
    m = (22 - 13) / (60 - 30)
    return m * (x - 30) + 13


def algorithmus(laenge, tiefe):
    if laenge > gerade(tiefe):  # Oberhalb
        return "Adelie"
    else:
        return "Gentoo"  # Unterhalb

